import Header from './Components/header.js'
import Masthead from './Components/masthead.js'
import Portfolio from './Components/portfolio.js'
import About from './Components/about.js'

import './App.css';
function App() {
  return (
    <div>
      <Header />
      <Masthead />
      <Portfolio />
      <About />
    </div>
  );
}

export default App;
